import React, { Component } from 'react'
import './App.css';

export class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      square1: null,
      square2: null
    }
  }

  onClick(props){
    console.log(this.props)
  }



  render() {
    return (
      <div className='App'>
        <div className='App-header'>
          <div>
            <button className='square' >X</button>
          </div>
        </div>
      </div>
    )
  }
}

export default App;
